import React from 'react';
import { EventsList } from '../TextInfo';
import '../App.css';


const Events = () => {
    return (
        <span>
            {EventsList.map( ( item, index ) => {
                let background = `url(../images/event/${item})`
                return (
                    <span key={index}>
                        <div className='event_img'>
                            <img src={background} alt="" />
                        </div>
                    </span>
                );
            } )}
        </span>
    );
}
export default Events
